import React from 'react';
import classes from './Post.module.css'

const Post = (props) => {
    return (
        <div>
            <div>
                <textarea></textarea>
                <button>add post</button>
            </div>
            <div className={classes.col}>
                add cars
            </div>
        </div>
    );
};

export default Post;
